import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    users: [
      ["user9", "bar", { id: 0 }],
      ["user1", "bar", { id: 1 }],
      ["user2", "bar", { id: 2 }],
      ["user3", "bar", { id: 3 }],
    ],
  };

  render() {
    return (
      <div className="App">
        <div className="container"></div>
      </div>
    );
  }
}

export default App;
